import React from "react";
import AppLayout from '../components/AppLayout';
import Head from "next/head";

const About = () => {
    return(
        <>
            <Head>
                <title>Study Board | About</title>
            </Head>
            <div>
                <div>About</div>
            </div>
        </>
    )
};

export default About
